import React from 'react';

const Contact = () => {
    return ( 
        <section className="section">
            <h2>Contact</h2>
            <div className="contact">
                <form action="post">
                    <label htmlFor="">Ingresa tu usuario</label>
                    <input type="email" name="" id="" placeholder="Ingresa tu email" />
                    <label htmlFor="">Ingresa tu usuario</label>
                    <input type="email" name="" id="" placeholder="Ingresa tu email" />
